import React from "react";
import "./todo/Todo";

import "./App.css";
import "./reset.css";

function App() {
  return (
    <div className="wrap">
      <div className="box">
        <div className="boxTop">
          <h2>To-Do-List</h2>
          <ul>
            <li>
              <input></input>
              <input></input>
              <button>추가하기</button>
            </li>
          </ul>
        </div>
        <div className="boxBottom">
          <div className="boxLeft">
            <h2>To Do</h2>
          </div>
          <div className="boxRight">
            <h2>Done</h2>
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
